import React, { Component } from "react";
import axios from "axios";
export class DataSearch extends Component {
  state = {
    data: []
  };
  getData = () => {
    axios
      .get("/data")
      .then(response => {
        this.setState({
          data: response
        });
      })
      .catch(err => {
        console.log(err);
      });
  };

  render() {
    console.log(this.state.data)
    return (
      <div>
        <button onClick={this.getData}>Retrieve data</button>
      </div>
    );
  }
}

export default DataSearch;
